import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSansSymbols-VariableFont_wght-normal.ttf', font);
this.addFont('NotoSansSymbols-VariableFont_wght-normal.ttf', 'NotoSansSymbols-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
